pragma solidity ^0.4.18;

import './TokenSale.sol';

contract SaleRegistry {
    address public owner;
        
    struct TokenInfo {
        string name;
        string url;
        address tokenAddress;
        address saleAddress;
        uint timeAdded;
    }
    
    TokenInfo[] public tokens;
    
    event newTokenSale(uint number);
    
    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }
    
    function SaleRegistry() public {
        owner = msg.sender;
    }
    
    function addToken(uint256 _rate, address _wallet, uint256 _supply, string _name, string _symbol, string _url) public onlyOwner {
        Crowdsale sale = new TokenSale(_rate, _wallet, _supply, _name, _symbol);
        tokens.push(TokenInfo({name: _name, url: _url, tokenAddress:address(sale.token), saleAddress:address(sale), timeAdded:now}));
        newTokenSale(tokens.length - 1);
    }
    
    function getToken(uint number) public view returns (string name, string url, address tokenAddress, address saleAddress, uint timeAdded) {
        TokenInfo token = tokens[number];
        return (token.name, token.url, token.tokenAddress, token.saleAddress, token.timeAdded);
    }

}
